import React, { Component } from "react";
import UserDetail from "./UserDetail";

class User extends Component {
  constructor() {
    super();
    this.state = {
      fName: "Aysha",
      lName: "Marty"
    }
  }

  render() {
    return (
      <div>
        <p>This is the User Component</p>
        <h1>User</h1>
        <h3>{this.state.fName} {this.state.lName}</h3>


        <UserDetail  /> 
      </div>
    );
  }
}

export default User;
